package del;

import java.util.*;

public class AdventOfCode2018Day5 {
    
    private static int react(String s) {
        // could be faster if inserted the string into a LinkedList at first but this one is not too bad either
        for (int i = 0; i < s.length() - 1; i++) {
            if (Character.toLowerCase(s.charAt(i)) == Character.toLowerCase(s.charAt(i + 1)) && s.charAt(i) != s.charAt(i + 1)) {
                s = s.substring(0, i) + s.substring(i + 2);
                i = (i - 2 < -1) ? -1 : i - 2;
            }
        }
        return s.length();
    }
    
    public static void main(String args[]) {

        System.out.println("Answer to the first part: " + react(input));
        
        // here comes the second part
        Set<Character> set = new HashSet<Character>();
        for (int i = 0; i < input.length(); i++) {
            set.add(Character.toLowerCase(input.charAt(i)));
        }
        
        int min = Integer.MAX_VALUE, len = -1;
        for (Character c : set) {
            String cut = input.replaceAll("[" + Character.toUpperCase(c) + c + "]*", "");
            if ((len = react(cut)) < min) {
                min = len;
            }
        }
        System.out.println("Answer to the second part: " + min);
    }
    
    private static String input = "";
}

